sparqlQuery:
SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/River>
      { ?uri  <http://dbpedia.org/ontology/length>  ?l }
    UNION
      { ?uri  <http://dbpedia.org/property/length>  ?l }
  }
ORDER BY DESC(?l)
OFFSET  0
LIMIT   1

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Person> ;
          <http://dbpedia.org/ontology/weight>  ?num
      { ?uri  <http://dbpedia.org/property/team>  <http://dbpedia.org/resource/Chicago_Bulls> }
    UNION
      { ?uri  <http://dbpedia.org/property/draftTeam>  <http://dbpedia.org/resource/Chicago_Bulls> }
    UNION
      { ?uri  <http://dbpedia.org/ontology/draftTeam>  <http://dbpedia.org/resource/Chicago_Bulls> }
  }
ORDER BY DESC(?num)
OFFSET  0
LIMIT   1

SELECT DISTINCT  ?uri
WHERE
  { <http://dbpedia.org/resource/Nanga_Parbat>
              <http://dbpedia.org/ontology/elevation>  ?elevation .
    ?uri      a                     <http://dbpedia.org/ontology/Mountain>
      { ?uri  <http://dbpedia.org/ontology/elevation>  ?otherelevation }
    UNION
      { ?uri  <http://dbpedia.org/property/elevationM>  ?otherelevation }
    FILTER ( ?otherelevation > ?elevation )
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?x  rdf:type         dbo:Album ;
        dbo:artist       res:Elvis_Presley ;
        dbo:releaseDate  ?y ;
        dbo:recordLabel  ?uri
  }
ORDER BY ASC(?y)
OFFSET  0
LIMIT   1

SELECT DISTINCT  ?uri
WHERE
  {   { ?uri  a                     <http://dbpedia.org/ontology/City> }
    UNION
      { ?uri  a                     <http://dbpedia.org/ontology/Town> }
    ?uri  <http://dbpedia.org/ontology/country>  <http://dbpedia.org/resource/Germany> ;
          <http://dbpedia.org/ontology/populationTotal>  ?population
    FILTER ( ?population > 250000 )
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/SoccerClub>
      { ?uri  <http://dbpedia.org/ontology/ground>  <http://dbpedia.org/resource/Spain> }
    UNION
      { ?uri  <http://dbpedia.org/property/ground>  ?ground
        FILTER regex(?ground, "Spain")
      }
  }

SELECT DISTINCT  ?uri
WHERE
  {   { ?uri  a                     <http://dbpedia.org/ontology/Lake> ;
              <http://dbpedia.org/ontology/country>  <http://dbpedia.org/resource/Denmark>
      }
    UNION
      { ?uri  a                     <http://dbpedia.org/class/yago/LakesOfDenmark> }
  }

SELECT  (COUNT(DISTINCT ?uri) AS ?c)
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Organisation>
      { ?uri  <http://dbpedia.org/ontology/industry>  <http://dbpedia.org/resource/Telecommunication> }
    UNION
      { ?uri  <http://dbpedia.org/property/industry>  ?industry
        FILTER regex(?industry, "Telecommunications")
      }
      { ?uri  <http://dbpedia.org/ontology/location>  <http://dbpedia.org/resource/Belgium> }
    UNION
      { ?uri  <http://dbpedia.org/property/locationCountry>  "Belgium"@en }
  }

SELECT DISTINCT  ?uri
WHERE
  {   { ?uri  <http://dbpedia.org/ontology/field>  <http://dbpedia.org/resource/Computer_science> }
    UNION
      { ?uri  <http://purl.org/dc/elements/1.1/description>  ?s
        FILTER regex(?s, "computer scientist", "i")
      }
    ?uri  <http://dbpedia.org/ontology/award>  <http://dbpedia.org/resource/Academy_Awards>
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Organisation>
      { ?uri  <http://dbpedia.org/ontology/formationYear>  ?date }
    UNION
      { ?uri  <http://dbpedia.org/ontology/foundingYear>  ?date }
    FILTER regex(?date, "^1930")
  }
